import { Link } from "react-router-dom/cjs/react-router-dom.min";

const Login = () => {
    return (
        <div>
            <p>Login</p>
            <div className="home-login">
                <form className="homelogin-form" onSubmit={handleLogi}>
                    <input type="email" placeholder="Enter Email" required className="homelogin-inputs"></input>
                    <input type="password" placeholder="Enter Password" required className="homelogin-inputs"></input>
                    <button className="homelogin-submit">Login</button>
                </form>
            </div>
        </div>
    );
}

export default Login;
